import Genre from "./Genre.jsx";
import styles from "../App.module.css";

function GenreList() {
	const genres = Genre();
	return (
		<div className={styles.genre}>
		<ul>
		{genres.title.map(genre => <li key={genre.title}> {genre}</li>)}
		{genres.image.map(image => <li key={genre.image}> <img src={image}/></li>)}
		</ul>
		</div>
	);
};

export default GenreList;
